function selectPage(index) {

    lc.setTool(new LC.tools.SelectShape(lc));

    $('.page-editor').removeClass('success');
    $(index).addClass('success');

    index = index.innerText;
    index = parseInt(index - 1);
    console.log("yoo whats the indx?", index);
    console.log(pages[index], "checck ");
    if(index < 0 || index >= pages.length) {
        return;
    }

    if(prevPage != -1) {
        pages[prevPage] = JSON.stringify(lc.getSnapshot());
        //console.log(pages[prevPage], prevPage);
    }

    lc.loadSnapshot(JSON.parse(pages[index]));
    lc.setTool(new LC.tools.SelectShape(lc));
    prevPage = index;
}

