//ajax functions to connect with api
function saveChapter() {
    var chapter_name = document.getElementById('chap_title').value;

    if(chapter_name == "") {
        alert_message("Chapter must have a title.", "alert");
        console.log("error title", chapter_name);
        return;
    }

    var chapter_id = document.getElementById('chap_id_hidden').value;
    var pages = saveAndReturnPages();
    console.log("pages", pages);
    var chapter = {
        '_id': chapter_id,
        'pages': pages ,
        'chapterTitle': chapter_name
    };
    $.ajax({
        url: "/api/series/chapter/save",
        type: "POST",
        xhrFields: {
           withCredentials: true
        },
        data: JSON.stringify(chapter),
        contentType: "application/json",
        success: function (data) {
            alert_message('Chapter successfully saved', 'success');
            console.log(data, "api worked");
        }
    });
}

function getChapterPagesJson(){
  var chapter_id = document.getElementById('chap_id_hidden').value;
  $.ajax({
      url: "/api/series/chapter/view/" + chapter_id,
      type: "GET",
      xhrFields: {
       withCredentials: true
      },
      contentType: "application/json",
      success: function (data) {
          console.log(data, " MAO ");

          if(data != 'error'){
            pages = JSON.parse(data);
          }

            loadPages();
      }
  });
}

function publishChapter() {
    //var chapter_id = document.getElementById('chap_id');
    var chapter_name = document.getElementById('chap_title').value;

    if(chapter_name == "") {
        alert_message("Chapter must have a title.", "alert");
        console.log("error title", chapter_name);
        return;
    }

    var chapter_id = document.getElementById('chap_id_hidden').value;
    var pagesExported = getImagesExportedData();

    if(pagesExported == 'error') {
        alert_message("Page cannot be empty.", "alert");
        return;
    }else {
        pagesExported = JSON.stringify(pagesExported);
    }

    var chapter = {
        '_id': chapter_id,
        'images':pagesExported,
        'chapterTitle': chapter_name
    };
    $.ajax({
        url: "/api/series/chapter/publish",
        type: "POST",
        xhrFields: {
           withCredentials: true
        },
        data: JSON.stringify(chapter),
        contentType: "application/json",
        success: function (data) {
            alert_message('Chapter successfully published', 'success');
        }
    });
}

