function alert_message(msg, type) {

    if($('#alert-box').text() == msg) {
        if($('#alert-box').css('display')  != 'none') {
            return;
        }
    }

    $('#alert-box').removeClass('success');
    $('#alert-box').removeClass('warning');
    $('#alert-box').removeClass('alert');

    $('#alert-box').addClass(type);
    $('#alert-box').text(msg);

    $('#alert-box').slideDown();

    $('#alert-box').delay(5000).slideUp();
}



